import React,{Component} from 'react';
import {Header , Icon, List} from 'semantic-ui-react';
import axios from 'axios';

class App extends Component {
  state = {
    AdresaF: []
  }
  componentDidMount(){
    axios.get('https://localhost:5001/api/AdresaFaturimit').then((response) => {
      console.log(response);
    this.setState({
        AdresaF: response.data
    })
    })
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
         <ul>
           {this.state.AdresaF.map((adresa : any) => ( //kjo eshte forma qysh loopim tek state me ja marr atributet
             <li key={adresa.id}>
               {adresa.Emri}
             </li>
           ))}
         </ul>
        </header>
      </div>
    );
  }

}

export default App;
